import React from "react";

class ShowUrls extends React.Component {
    renderRow = (url) => {
        return <tr>
            <td><a href={url} target="_blank">{url}</a></td>
        </tr>
    }

    render() {
        let urlList = this.props.urlList;
        if (urlList.length > 0) {
            return <table id="url-table" border="1px solid black">
                <tbody>{this.props.urlList.map(this.renderRow)}</tbody>
            </table>
        } else {
            return <div id="no-url"><b>No URLs were found in the image</b></div>
        }
    }
}

export default ShowUrls;
